import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./project/home.js";
import Contact from "./project/contact.js";
import Reservation from "./project/reservation.js";
import Menu from "./project/menu";

function App() {


  food=[{category: "Appetizer", name: "Nugget", img: "https://burgeroclock.com.pk/_next/image?url=https%3A%2F%2Fassets.indolj.io%2Fimages%2F1637903077-1632055287-Wings-Crispy-min.png&w=256&q=75", desc: "Chicken wings blended with special in-house flavor served with sauce", price: "599"},
  {category: "Main Course", name: "Burger", img: "https://burgeroclock.com.pk/_next/image?url=https%3A%2F%2Fassets.indolj.io%2Fimages%2F1637903678-1622211226-Fiery-Chicken-Value-Burger-min.jpg&w=256&q=75", desc: "Fiery, crispy indulged with crispy fried chicken patty topped with BOC special chipotle", price: "499"}]



  return (
    <>
      <Router>
        <div>
          <Routes>
            <Route exact path="/" element={<Home/>} />
            <Route exact path="/contact" element={<Contact/>} />
            <Route exact path="/reservation" element={<Reservation/>} />
            <Route exact path="/menu" element={<Menu food={food}/>} />
          </Routes>
        </div>
      </Router>
    </>
  );
}

export default App;
